import React, { useState } from 'react'
import UserService from '../../services/user.service';
import AuthService from '../../services/auth.service'
import './UserDashboard.css'

function UserDashboard() {

    const [user, setUser] = useState({
        aplicarii: []
    });
    const currentUser = AuthService.getCurrentUser();
    UserService.getUserAplicarii(currentUser.id).then(
        response => {
            setUser(response.data);
        }
    );



    return (
        <div id="wrapper">
            <div class="overlay"></div>


            <nav class="fixed-top align-top" id="sidebar-wrapper" role="navigation">
                <div style={{ padding: "0px;" }}>
                    <a class="sidebar-brand" href="index.html">
                        <span class="align-middle">Vishweb Design</span>
                    </a>

                    <ul class="navbar-nav align-self-stretch">
                        <li class="sidebar-header">
                            Profile
                        </li>
                        <li>
                            <a class="nav-link text-left active" role="button" aria-haspopup="true" aria-expanded="false">
                                <i class="flaticon-bar-chart-1"></i> Aplicarii
                              </a>
                        </li>
                    </ul>


                </div>


            </nav>

        </div>

    )
}

export default UserDashboard


